import Style from './MenuInterno.module.css'
import { Link } from 'react-router-dom'
function MenuInterno() {
    return (
        <div className={Style.Geral}>
            <Link to={props.link} >
                <div>{props.img}</div>
                <div>{props.texto}</div>
            </Link>
        </div>
    )
}
export default MenuInterno
